import React from 'react';
import * as animation from '../Assets/animation.jpg';
import { Menu, Grid, Item, Header, Image, Icon, Button} from 'semantic-ui-react';


class LandingPage extends React.Component {
    render () {
		return (
            <React.Fragment>
                <Grid>
                    <Grid.Row>
                    {/* Top Menu */}
                        <Menu inverted fixed="top" fluid widths={7} secondary style={{ height: '10vh', background: '#D3D3D3' }}>
                            <Menu.Item position='left' style={{ cursor: 'pointer'}} onClick={this.handleMenuItemClick}>
                                <Header as='h3' style={{ cursor: 'pointer' }}>
                                    <Icon name='sidebar'/>
                                </Header>
                            </Menu.Item>

                            <Menu.Item position='right' style={{ cursor: 'pointer' }} onClick={this.handleUserItemClick}>
                            <Header as='h3'>
                                <Button circular>
                                    Barista Login
                                </Button>
                            </Header>
                            </Menu.Item>
                        </Menu>
                    </Grid.Row>
                    <Grid.Row>

                    </Grid.Row>
                </Grid>
            </React.Fragment>
        );
    }
}

export default LandingPage
